import React, { useState } from 'react';
import { Form, Input, Checkbox, Switch, Radio, Button, Select, Typography } from 'antd';
import { UserOutlined, LockOutlined } from '@ant-design/icons';

const { Group: RadioGroup } = Radio;

const { Option } = Select;// Định nghĩa RadioGroup từ Radio

const ComponentForm: React.FC = () => {

  const inputText = [
    {
      title: 'Username:',
      value: 'username',
      type: 'text',
      placeHolder: 'Username',
      error: 'Please input your username!',
    },
    {
      title: 'Password:',
      value: 'password',
      type: 'password',
      placeHolder: 'Password',
      error: 'Please input your password!',

    },
    {
      title: 'Text Field:',
      value: 'textField',
      type: 'text',
      placeHolder: 'Text Field',
      error: 'Please input text field!',
    },
  ];

  const [rememberMe, setRememberMe] = useState(false);
  const [switchValue, setSwitchValue] = useState(false);
  const [radioValue, setRadioValue] = useState(1);

  const handleSwitchChange = (checked: boolean) => {
    setSwitchValue(checked);
  };

  const handleRadioChange = (e: any) => {
    setRadioValue(e.target.value);
  };

  const handleCancel = () => {
    // 
  };

  const handleNext = () => {
    // 
  };

  const options = [
    { label: 'Option 1', value: 'option1' },
    { label: 'Option 2', value: 'option2' },
    { label: 'Option 3', value: 'option3' },
  ];

  return (
    <Form>
      <Form.Item name="FormConponent">
        {inputText.map((item) => (
          <div
            key={item.value}>
            <Typography.Text className='title'>{item.title}</Typography.Text>
            <div>
              <Form.Item
                name={item.value}
                rules={[
                  {
                    required: true,
                    message: item.error,
                  },
                ]}
              >
                <Input
                  prefix={item.value === 'password' ? <LockOutlined /> : <UserOutlined />}
                  type={item.type}
                  placeholder={item.placeHolder}
                />
              </Form.Item>
            </div>
          </div>
        ))}
      </Form.Item>
      <div>
        <Form.Item>
          <Checkbox
            checked={rememberMe}
            onChange={e => setRememberMe(e.target.checked)}
          >
            Remember me
          </Checkbox>
        </Form.Item>
      </div>
      <div>
        <Form.Item>
          <Switch
            checked={switchValue}
            onChange={handleSwitchChange}
          />
        </Form.Item>
      </div>
      <div>
        <Form.Item>
          <RadioGroup
            onChange={handleRadioChange}
            value={radioValue}>
            <Radio value={1}>Button 1</Radio>
            <Radio value={2}>Button 2</Radio>
            <Radio value={3}>Button 3</Radio>
          </RadioGroup>
        </Form.Item>
      </div>
      <div>
        <Form.Item>
          <label className="dropdown-title">Dropdown Title</label>
          <Form.Item name="dropdown" label="Dropdown">
        <Select placeholder="Select option">
          {options.map(option => (
            <Option key={option.value} value={option.value}>
              {option.label}
            </Option>
          ))}
        </Select>
      </Form.Item>
        </Form.Item>
      </div>
      <div>
        <Form.Item>
          <Button onClick={handleCancel}> Cancel </Button>
          <Button type="primary" onClick={handleNext}> Next </Button>
        </Form.Item>
      </div>
    </Form>
  );
};

export default ComponentForm;
